PROTECTED STRUCTURE: The development will consist of the change of use and amalgamation of the existing office, educational and residential uses to a 1no. two storey with attic detached dwelling unit that will contain seven bedrooms with study, plus separate garage and ancillary accommodation. The overall works will include general refurbishment and repair of the main house to a single dwelling unit to include:
-removal of non-original internal stud walls, lift and other features; and the carrying out of conservation works to include construction of new internal stud walls, service riser and changes to opes that alter the internal layout on all floors;
-replacement of external window opes with doors on south (ground floor only) and west elevation (both ground and first floor) of non-original two storey extension, and at ground floor off original house, all to rear;
-new single storey plant room (10sqm) to west elevation of non-original two storey extension to rear;
-construction of new terrace (22sqm) at first floor level to west elevation, with new solar panel (10sqm) on internal roof valley of non-original two storey extension to rear;
-repair and replacement of fenestration where required;
-general repair and refurbishment of the single storey detached lodge (67sqm) to provide ancillary accommodation to the house;
-removal of single storey lecture theatre (210sqm) to rear;
-removal of single storey out-building (22sqm) to rear;
-construction of new single storey detached garage (50sqm);
-construction of new glasshouse (40sqm); and
-all associated conservation, landscaping, including gazebo, site development works, revision to internal road/parking layout and use of the existing vehicular access off Shrewsbury Road.

