PROTECTED STRUCTURE: Change of use of ground, 1st, 2nd and 3rd floors of these two combined four storey over basement 'protected structures' from office to residential use comprising a total of 8 no. single bedroom apartments (with 2 per floor) with new stairs access to roof level in a new pitched roof (and 6 no. roof lights) enclosure over No. 13 and extending across front and rear of No. 12 in two mono pitch roofs (as parapets) enclosing a new communal roof garden (over No. 12 primarily); also to install new lift from ground to 3rd floor level as well as the following alterations and additions;
(i) Renewal of stairs flight from ground floor to new half landing including relocation of door in party wall to rear corridor;
(ii) Removal of later stud walls to ex toilets on ground, 1st and 3rd floors and including internal office on 2nd floor;
(iii) Removal of roof light, water storage enclosure and air handling unit from roof;
(iv) Renewal and structural upgrading of existing flat roof for use as roof garden;
(v) Removal and replacement of all pvc windows on these floors and replacement with approved up and down timber sash types;
(vi) Repairs to brickwork, pointing, cills and reveals to front and renewal of brickwork at ground level to rear facade;
(vii) Provision of new balcony to rear on each of 1st and 2nd floors and two at ground level; to include
(viii) Opaque glazed screening of rear yards to basement apartments and
(ix) All external works and landscaping associated with rear public open space, bin storage and car and bicycle parking.

RETENTION: Amendments to a development previously approved under Reg.Ref: 2371/10 for the development of a state-of-the-art administration, sports, social, religious, heritage and recreational facilities at this 2.67 hectare (6.6 acre) site at St Joseph's, Cabra, Dublin 7, bounded by the N3 Navan Road to the south west and Ratoath Road to the north east.
Retention Permission is sought for the following:
i) Amendments to the layout of the all weather pitches and associated floodlighting;
ii) Relocation of storage building of 72 sq.m to the eastern boundary, increase in size to 75 sq.m gross, and amendment to the layout and design of the building;
iii) Amendments to the sports, social and administrative building to include the following:
a) Reconfiguration of footprint and building line, including: incorporation of the sports hall storage rooms into the building footprint at north elevation; the removal of the regional desk office of 40 sq.m gross floor area and associated amendment to building line at north elevation, new profile to Chapel and atrium at the southern elevation;
b) At first floor level, amendment to layout of fitness gym and viewing gallery, extension and amendment of roof terrace (increase in size of roof terrace from 65 sq.m to 110 sq.m gross floor area), and amendment to building line around multi-purpose room on the southern elevation;
c) Amendments to elevations to include: insertion of stained glass windows into Chapel on south elevation and insertion of new exit door; insertion of new entrance gate to the service yard on south elevation; render finish to replace metal cladding on parts of the south and north elevation; tegral eternit fibre cement cladding panel finish to replace metal cladding finish on parts of the north, south and east elevations; insulated render finish to replace cavity blockwork with render finish to parts of the south, east and west elevation; amendment to window detail at landing on first floor level of south elevation; increase in height of rooflight over central circulation space from 0.65 metres to 2.45 metres on north and south elevation; amendments to location and extent of windows and doors at ground floor level on north elevation; high level windows to Sports Hall removed and metal cladding to corner removed on north, east and  west elevation; location and design of windows and doors at lower level on north elevation amended; render finish to replace stone and infill metal cladding to part of the east elevation; addition of louver screen of 2.05 metres high to roof top plant area on west elevation, elevation treatment of doors amended on west elevation;
iv) Amendments to the Chapel Wing building to include the following:
a) New entrance door in existing opening on north-eastern elevation;
b) Retention of existing lean-to roof and associated windows;
c) Approved fire escape stairs structure to north-east elevation brought into fabric of the building resulting in the loss of 1 No. parent and visitor accommodation unit and revised elevational treatment to north-east elevation;
d) Insertion of smoke vent to north-east elevation;
e) Tegral eternit fibre cement cladding panel finish to replace metal cladding finish on parts of the elevation;
f) Existing windows to north-west and south west elevations retained;
g) New door opening created and solid timber door inserted at north-east elevation.
v) All ancillary and associated works.
Planning Permission is sought for change of use of 6 No. parent and visitor accommodation units at first floor of 164 sq.m gross floor area in total to 6 No. office units. The amendments to the development will result in a decrease of the gross floor area of the development approved under Reg. Ref: 2371/10 from 6,687 sq.m to 6,477 sq.m gross floor area.

