For full planning permission and retention planning permission at existing ground floor retail unit no 3 part of existing ground floor retail unit no. 5 and part of existing first, all at the Trinity Bioscience building approved under Reg. Ref: 4995/06. Full planning permission is sought for the following:
(i) subdivision of ground floor retail unit 5 (1,098 sq.m) to create three separate units of 228 sq.m (Unit 5a), 712 sq.m (Unit 5B) and 69 sq.m (Unit 5C) and the amalgamation of the remaining part of Unit 5 (80 sq.m) with Unit 4 (173 sq.m) to increase the size of Unit 4 to 253 sq.m; 
(ii) change of use of unit 5B (712 sq.m) from retail use to science and technology based industry use;
(iii) change of use of unit 5C (69 sq.m) from retail use to retail/restaurant/café/financial services use;
(iv) subdivision of existing ground floor retail unit 3 (351sq.m) to create two separate units of 330sq.m (Unit 3A) and 21 sq.m (Unit 3B); 
(v) change of use of unit 3A (330 sq.m) from retail use to science and technology based industry use; 
(vi) Change of use of unit 3B (21 sq.m) from retail use to retail/restaurant/café/financial services use;
(vii) proposed 4 no. non-illuminated fascia signs, comprising 2 no. signs to the concourse frontage of each of the proposed retail/restaurant/café/financial services units (Units 5C and 3B), and 2 no. projecting signs, one to each of unit 3B and unit 5C;
(viii) change of use of 1,578 sq.m of first floor commercial office floor space to science and technology based industry use; 
(ix) All associated and ancillary works. The proposed development will provide 2,620 sq.m gross science and technology based industry floor space and 90 sq.m retail/restaurant/café/financial services floor space. It is proposed that no more than 50% of the floor space of the 2 no. proposed retail/restaurant/café/financial services units subject to this application shall be occupied by any one of a café or restaurant use approved under this permission in the absence of a separate planning permission. Retention planning permission is sought for the following
(i) retention of the existing shopfront design to the concourse elevation of unit no. 3 and 5 as required pursuant to Condition 6 of Reg Ref: 4995/06 and
(ii) minor internal alterations and all associated and ancillary works.

RETENTION: Planning permission and retention permission at existing retail, buidling approved under Reg. Ref: 4995/06. Full planning permission is sought for the following: 
(i) the change of use of existing unit 1 (82 sq.m gross floorspace) from retail to reatil/café/restaurant/financial services use; 
(ii) the change of use of existing unit 2 (229 sq.m) from retail to retail/café/restaurant/financial services use; 
(iii) the sub-division of existing unit 5 (1,089sq.m) to provide 2 no. units, unit 5B (781 sq.m) with frontage to the central concourse area and unit 5A (228 sq.m) to the north with frontage to Pearse Street and Sandwith Street, and the change of use of unit 5A from retail to reatil/café/restaurant/financial servicesuse;
(iv) the amalgamation of existing unit 4 (173 sq.m) with part (80 sq.m) of existing retail unit 5 (1089 sq.m gross) to increase unit 4 to 253sq.m and the change of use of unit 4 (263sq.m) from retail to retail/café/restaurant/financial services use; 
(v) proposed signage to each of retail units 1,2,4 and 5A comprising of non-illuminated fascia signs and a double-sided illuminated projecting sign to each unit. This comprises;(a) 2 no. fascia signs and 1 no. projecting sign to the north elevation and 1 no. fascia sign to the west elevation of unit 1; (b) 3 no. fascia signs and 1 no. projecting sign to the north elevation and 3 no. fascia signs to the concourse elevation of unit 2; (c) 3 no. fascia signs and 1 no. projecting sign to the north elevation and 3 no. fascia signs to the concourse elevation of unit 4; (d) 2 no. fascia signs and 1 no. projecting sign to the north elevation and 1 no. fascia sign to the east elevation of unit 5 
(vi) all associated and ancillary works. The proposed development  results in the provision of 792 sq.m gross retail/restaurant/café/financial services floorspace. It is proposed that no more than 50% of the floorspace subject to change of use to retail/restaurant/café/ financial services units subject in this application shall be occupied by any one of a café or restaurant use approved under this permission in the absence of a separate planning permission. Retention permission is sought for the following:
(i) retention of the existing shopfront design to retail units 1,2,4 and 5 as required pursuant to Condition 6 of Reg. Ref: 4995/06 and
(ii) minor internal alterations and all associated and ancillary works.

