The development will consist of the construction of a single storey(maximum height 6.6 metres), 80 seater Drive Thru restaurant
(294.7sq.m gross floor area).  
The development comprises: 
(i) an 80 no. customer seating area;
(ii) preparation, service and storage areas, staff facilities, and customer toilets;
(iii) provision of a drive-thru with vehicular circulation;  
(iv) signage on the east and south elevations as well as associated vehicular signage;
(v) 30 no. car parking spaces, bicycle parking, external seating, paving, plant and lighting and all ancillary site development works and site services.

PROTECTED STRUCTURE: Development at Unit no. 3 (a ground floor retail unit measuring 242 sq.m with an existing communal yard, bin store, switch room and E.S.B sub station). 

The development comprises :
(i) a change of use from the pharmacy use permitted under Reg. Ref. 1994/04 to use as a restaurant incorporating a hot food takeaway; 
(ii) alterations to the ground floor layout to include provision of a seating area, customer toilets, service area, chillers/freezer, staff areas and the provision of air conditioning units with an existing store area; 
(ii) the provision of a new air louver on the rear elevation (1.78m x 163m); 
(iv) erection of signage the north facing elevation measuring 1.092m x 0.3m (advertising area  0.33 sq.m). The signage comprises individual stainless steel lettering;
(v) all ancillary site development works and services.

New development on lands at Panhandle Park, Clongriffin, Dublin 13 comprising:

(a) a 3-storey domed mosque and cultural centre (5573sqm) which includes main prayer hall, prayer rooms, meeting rooms, general purpose room, administrative offices, 1 ground floor 1-bed apartment, créche, bookshop, library, mortuary, ancillary accommodation and two minarets which is linked to:  

(b) a 2-storey conference centre (2849sqm) which includes reception foyer, 600-seat conference room, 130 seat restaurant, 200-seat single-storey banquet hall,  kitchens and ancillary accommodation;  

(c) a 2 to 3-storey 16-classroom primary school and a 2 to 3-storey 12-classroom secondary school, each with its own administrative and ancillary accommodation. shared multi-use community hall, storage, ancillary accommodation and plant (total area 6809sqm), outdoor play space and ball courts;  

(d) a 2-storey fitness centre (1392sqm) which includes a 25m indoor swimming pool, gym, sauna, steam room, administrative and ancillary accommodation, plant;  

(e) a 3-storey block of 6 no. 2-bed apartments with balconies on the south and west elevations;  and 

(f) a 4-storey block of 2 no. 1-bed apartments, 5 no. 2-bed apartments with balconies on the east and south elevations, and ground floor shop (231sqm).

The development is accessed from Main Street,  Park Avenue and Marshfield Avenue Clongriffin via the internal road network and includes 192 surface car parking spaces, 221 bicycle parking spaces, landscaped gardens and all associated and ancillary site works.

