Permission sought for the following:-  
(i) Extension of existing premises No 35 Lower Dorset St. into 34A Lower Dorset Street (Building Contractor's site of 128 sqm.) to the rear of 35 and 34 Lower Dorset Street facing onto Dorset Lane, and the amalgamation of same into the overall planning site;  
(ii) demolition of the existing single storey buildings and the change of use of building contractor premises to retail and ancillary uses; 
(iii) construction of part one, part two storey extensions on amalgamated building;  
(iv) extension of retail sales space (117sqm.) at ground floor giving a net floor area of 314sqm., with subsidiary alcohol sales; and ancillary office, staff canteen, and storage area at first floor, with new relocated access door unto Dorset Lane;  
(v) Partial demolition and refurbishment of the existing retail area, incorporating minor alterations;  
(vi) provision of a lift to serve ancillary storage room and staff facilities at first floor level;  first floor windows facing onto Dorset Lane;  
(vii) elevational modifications to shop front, signage and windows on lower Dorset St. on foot of planning conditions (Ref; 4190/10); 
(viii)  Planning permission also sought for the amalgamation of four studio apartments at first and second floor of 35 Lower Dorset Street, and their conversion to a single two bed duplex apartment with balcony at second floor to the rear, including associated internal alterations;  velux rooflight and the re-opening to to stairway window at first floor level; 
(ix) Planning permission also sought for the provision of new ancillary plant over single storey element of existing supermarket and ancillary site development works and site services, with overall access onto Dorset Street, Dorset lane and North Circular Road.
